    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent datan               set, or they can be combined to cover the entire
    nation.nn               Linear Water Features includes single-line drainage water
    features and artificial path features that run through double-line drainage features
    such asn               rivers and streams, and serve as a linear representation
    of these features.  The artificial path features may correspond to those in the
    USGS Nationaln               Hydrographic Dataset (NHD).  However, in many cases
    the features do not match NHD equivalent feature and will not carry the NHD metadata
    codes.  Thesen               features have a MAF/TIGER Feature Classification Code
    (MTFCC) beginning with an "H" to indicate the super class of Hydrographic Features.
